func animate_new(From startProportion: CGFloat, To endProportion: CGFloat, Duration duration: CFTimeInterval = 5.0) {
    let animation = CABasicAnimation(keyPath: "strokeEnd")
    animation.duration = duration
    animation.fromValue = startProportion
    animation.toValue = endProportion
    animation.timingFunction = CAMediaTimingFunction(name: kCAMediaTimingFunctionEaseOut)
    myShapeLayer.strokeEnd = endProportion
    myShapeLayer.strokeStart = startProportion
    myShapeLayer.add(animation, forKey: "strokeEnd")
}

func animatePathChange(for layer: CAShapeLayer, toPath: CGPath) {
    let animation = CABasicAnimation(keyPath: "position")
    animation.duration = 10.0
    animation.repeatCount = 10
    animation.fromValue = layer.path
    animation.toValue = toPath
    animation.timingFunction = CAMediaTimingFunction(name: "easeInEaseOut")
    myShapeLayer.add(animation, forKey: "position")
}
